commits.content:
{
  "expo": {
    "plugins": [
      [
        "expo-document-picker"
      ],
      [
        "expo-dev-client",
        {
          "version": "5.0.20"
        }
      ],
      [
        "expo-location",
        {
          "locationPermissionDescription": "This app uses your location to show nearby users."
        }
      ],
      [
        "expo-notifications",
        {
          "icon": "./assets/icons/logo.png",
          "color": "#ffffff",
          "notificationChannelName": "default"
        }
      ]
    ],
    "name": "Skill Link",
    "slug": "skill-link",
    "version": "1.0.0",
    "orientation": "portrait",
    "icon": "./assets/icons/logo.png",
    "userInterfaceStyle": "light",
    "newArchEnabled": true,
    "splash": {
      "image": "./assets/icons/logo.png",
      "resizeMode": "contain",
      "backgroundColor": "#ffffff"
    },
    "ios": {
      "supportsTablet": true,
      "bundleIdentifier": "com.mdabdulrahman.skilllink"
    },
    "android": {
      "permissions": [
        "ACCESS_FINE_LOCATION",
        "ACCESS_COARSE_LOCATION",
        "ACCESS_BACKGROUND_LOCATION",
        "FOREGROUND_SERVICE"
      ],
      "package": "com.mdabdulrahman.skilllink",
      "googleServicesFile": "./google-services.json",
      "adaptiveIcon": {
        "foregroundImage": "./assets/icons/logo.png",
        "backgroundColor": "#ffffff"
      }
    },
    "web": {
      "favicon": "./assets/favicon.png"
    },
    "extra": {
      "eas": {
        "projectId": "8fa0f426-f81a-49b8-8a5a-2667e6b787f9"
      }
    },
    "owner": "mdabdulrahman"
  }
}
